import React, { Fragment, useState } from 'react'
import { Link } from "react-router-dom";

const Landing: React.FC  = () => {
  const [btnHover, setButtonHover] = useState(false)
  return (
    <Fragment>
    <div className="hero-wrapper">
      <img src="/assets/logo.svg" alt="Pitchers Logo"/>
    </div>
    <div className="landing-links">
      <ul>
        <li>
          <Link to="/" 
          className="highlight" 
          onMouseOver={() => setButtonHover(true)}
          onMouseOut={() => setButtonHover(false)}
          >
          <span className="hover-bg" style={btnHover === true ?  { width: "100%" } : { width: "0" }}></span>
          <p>View menus</p></Link></li>
        <li><Link to="/">Make a booking</Link></li>
        <li className="hide-btn"><Link to="/">Bar information</Link></li>
      </ul>
    </div>
    </Fragment>
  )
}

export default Landing;
